let iconMenu=document.querySelector(".icon-menu");if(null!=iconMenu){let e=document.querySelector(".menu__wrapper");iconMenu.addEventListener("click",(function(c){iconMenu.classList.toggle("_active"),e.classList.toggle("_active")}))}function menu_close(){let e=document.querySelector(".icon-menu"),c=document.querySelector(".menu__wrapper");e.classList.remove("_active"),c.classList.remove("_active")}